risky.[accelerate]:
(
        (
            (
             (seen_ped = 1) & (visibility = 1)
            ) &
            (
                (
                    (
                        is_on_sidewalk
                    ) & (
                        (car_x - ped_x) > (2*car_v)
                    )
                ) | (
                    (
                        (car_x - ped_x) <= (2*car_v)
                    ) & (
                        car_v < 2
                    )
                )
            )
        ) |
        (
            (
                (seen_ped = 1) & (visibility = 0)
            ) & 
            (
                (
                    (
                        is_on_sidewalk
                    ) & (
                        (car_x - block_x2) > (2*car_v)
                    )
                ) | (
                    (
                        (car_x - block_x2) <= (2*car_v)
                    ) & (
                        car_v < 2
                    )
                )
            )
        )
    | (
            (seen_ped = 0) & (visibility = 0)
        )
       )

risky.[brake]:
(
        (
            (
                (seen_ped = 1) & (visibility = 1)
            ) &    (
                (
                    car_v > 0
                ) & (
                    (
                        (car_x - ped_x) <= (2*car_v)
                    ) & (
                        car_v > 2
                    )
                ) | (
                    (
                        !is_on_sidewalk
                    ) & (
                        car_x < ped_x
                    )
                )
            )
        ) | (
            (
                (seen_ped = 1) & (visibility = 0)
            ) & (
                (
                    car_v > 0
                ) & (
                    (
                        (car_x - block_x2) <= (2*car_v)
                    ) & (
                        car_v > 2
                    )
                ) | (
                    (
                        !is_on_sidewalk
                    ) & (
                        car_x < block_x2
                    )
                )
            )
        )
    )

risky.[nop]:
(
        (
            (
                (seen_ped = 1) & (visibility = 1)
            ) &    (
                (
                    (
                        (car_x - ped_x) <= (2*car_v)
                    ) & (
                        car_v = 2
                    )
                ) | (
                    !is_on_sidewalk & (car_x >= ped_x)
                )
            )
        ) | (
            (
                (seen_ped = 1) & (visibility = 0)
            ) & (
                (
                    (
                        (car_x - block_x2) <= (2*car_v)
                    ) & (
                        car_v = 2
                    )
                ) | (
                    !is_on_sidewalk & (car_x >= block_x2)
                )
            )
        ) 
    )
